/** * This structure is used to describe dialog's participants, which in this * case is local party (i.e. us) and remote party. */
typedef struct pjsip_dlg_party
{ pjsip_fromto_hdr *info; /**< From/To header, inc tag. */ pj_str_t info_str; /**< String rep of info header. */ pj_uint32_t tag_hval; /**< Hashed value of the tag. */ pjsip_contact_hdr *contact; /**< Contact header. */ pj_int32_t first_cseq;/**< First CSeq seen. */ pj_int32_t cseq; /**< Next sequence number. */
} pjsip_dlg_party;
/** * This structure describes the dialog structure. Application MUST NOT * try to SET the values here directly, but instead it MUST use the * appropriate dialog API. The dialog declaration only needs to be made * visible because other PJSIP modules need to see it (e.g. INVITE session, * the event framework, etc.). * * Application MAY READ the dialog contents directly after it acquires * dialog lock. * * To acquire dialog lock, use #pjsip_dlg_inc_lock(), and to release it, * use #pjsip_dlg_dec_lock(). DO NOT USE pj_mutex_lock()/pj_mutex_unlock() * on the dialog's mutex directly, because this will not protect against * dialog being destroyed. */
struct pjsip_dialog
{ /** The dialog set list. */ PJ_DECL_LIST_MEMBER(pjsip_dialog); /* Dialog's system properties. */ char obj_name[PJ_MAX_OBJ_NAME]; /**< Standard id. */ pj_pool_t *pool; /**< Dialog's pool. */ pjsip_user_agent *ua; /**< User agent instance. */ pjsip_endpoint *endpt; /**< Endpoint instance. */ pj_grp_lock_t *grp_lock_; /**< Dialog's grp lock. Do not call!! Use pjsip_dlg_inc_lock() instead! */ /** The dialog set which this dialog belongs (opaque type). */ void *dlg_set; /* Dialog's session properties. */ pjsip_dialog_state state; /**< Dialog state. */ pjsip_uri *target; /**< Current target. */ pjsip_target_set target_set; /**< Target set, for UAC only. */ pjsip_hdr inv_hdr; /**< Headers from hparam in dest URL */ pjsip_dlg_party local; /**< Local party info. */ pjsip_dlg_party remote; /**< Remote party info. */ pjsip_hdr rem_cap_hdr;/**< List of remote capability header. */ pjsip_role_e role; /**< Initial role. */ pj_bool_t uac_has_2xx;/**< UAC has received 2xx response? */ pj_bool_t secure; /**< Use secure transport? */ pj_bool_t add_allow; /**< Add Allow header in requests? */ pj_bool_t ack_sent; /**< ACK has been sent? */ pjsip_cid_hdr *call_id; /**< Call-ID header. */ pjsip_route_hdr route_set; /**< Route set. */ pj_bool_t route_set_frozen; /**< Route set has been set. */ pjsip_auth_clt_sess auth_sess; /**< Client authentication session. */ pj_str_t initial_dest;/**< Initial destination host (used for verifying remote TLS cert). */ /** Session counter. */ int sess_count; /**< Number of sessions. */ /** Transaction counter. */ int tsx_count; /**< Number of pending transactions. */ /** Transport selector. */ pjsip_tpselector tp_sel; /* Dialog usages. */ unsigned usage_cnt; /**< Number of registered usages. */ pjsip_module *usage[PJSIP_MAX_MODULE]; /**< Array of usages, priority sorted */ /** Module specific data. */ void *mod_data[PJSIP_MAX_MODULE]; /**< Module data. */ /** * If via_addr is set, it will be used as the "sent-by" field of the * Via header for outgoing requests as long as the request uses via_tp * transport. Normally application should not use or access these fields. */ pjsip_host_port via_addr; /**< Via address. */ const void *via_tp; /**< Via transport. */
};

