/** * This enumeration describes invite session state. */ typedef enum pjsip_inv_state { PJSIP_INV_STATE_NULL, /**< Before INVITE is sent or received */ PJSIP_INV_STATE_CALLING, /**< After INVITE is sent */ PJSIP_INV_STATE_INCOMING, /**< After INVITE is received. */ PJSIP_INV_STATE_EARLY, /**< After response with To tag. */ PJSIP_INV_STATE_CONNECTING, /**< After 2xx is sent/received. */ PJSIP_INV_STATE_CONFIRMED, /**< After ACK is sent/received. */ PJSIP_INV_STATE_DISCONNECTED, /**< Session is terminated. */ } pjsip_inv_state; /** * This structure describes the invite session. * * Note regarding the invite session's pools. The inv_sess used to have * only one pool, which is just a pointer to the dialog's pool. Ticket * https://github.com/pjsip/pjproject/issues/877 has found that the memory * usage will grow considerably everytime re-INVITE or UPDATE is * performed. * * Ticket #877 then created two more memory pools for the inv_sess, so * now we have three memory pools: * - pool: to be used to allocate long term data for the session * - pool_prov and pool_active: this is a flip-flop pools to be used * interchangably during re-INVITE and UPDATE. pool_prov is * "provisional" pool, used to allocate SDP offer or answer for * the re-INVITE and UPDATE. Once SDP negotiation is done, the * provisional pool will be made as the active pool, then the * existing active pool will be reset, to release the memory * back to the OS. So these pool's lifetime is synchronized to * the SDP offer-answer negotiation. * * Higher level application such as PJSUA-LIB has been modified to * make use of these flip-flop pools, i.e. by creating media objects * from the provisional pool rather than from the long term pool. * * Other applications that want to use these pools must understand * that the flip-flop pool's lifetimes are synchronized to the * SDP offer-answer negotiation. * * The lifetime of this session is controlled by the reference counter in this * structure, which is manipulated by calling #pjsip_inv_add_ref and * #pjsip_inv_dec_ref. When the reference counter has reached zero, then * this session will be destroyed. */ struct pjsip_inv_session { char obj_name[PJ_MAX_OBJ_NAME]; /**< Log identification */ pj_pool_t *pool; /**< Long term pool. */ pj_pool_t *pool_prov; /**< Provisional pool */ pj_pool_t *pool_active; /**< Active/current pool*/ pjsip_inv_state state; /**< Invite sess state. */ pj_bool_t cancelling; /**< CANCEL requested */ pj_bool_t pending_cancel; /**< Wait to send CANCEL*/ pjsip_tx_data *pending_bye; /**< BYE to send later */ pjsip_status_code cause; /**< Disconnect cause. */ pj_str_t cause_text; /**< Cause text. */ pj_bool_t notify; /**< Internal. */ pj_bool_t sdp_done_early_rel; /**< Nego done in early med was reliable? */ unsigned cb_called; /**< Cb has been called */ pjsip_dialog *dlg; /**< Underlying dialog. */ pjsip_role_e role; /**< Invite role. */ unsigned options; /**< Options in use. */ pjmedia_sdp_neg *neg; /**< Negotiator. */ unsigned sdp_neg_flags; /**< SDP neg flags. */ pjsip_transaction *invite_tsx; /**< 1st invite tsx. */ pjsip_tx_data *invite_req; /**< Saved invite req */ pjsip_tx_data *last_answer; /**< Last INVITE resp. */ pjsip_tx_data *last_ack; /**< Last ACK request */ pj_int32_t last_ack_cseq; /**< CSeq of last ACK */ void *mod_data[PJSIP_MAX_MODULE];/**< Modules data. */ struct pjsip_timer *timer; /**< Session Timers. */ pj_bool_t following_fork; /**< Internal, following forked media? */ pj_atomic_t *ref_cnt; /**< Reference counter. */ pj_bool_t updated_sdp_answer; /**< SDP answer just been updated? */ }; 下面的代码显示了可以应用于会话的各种选项。创建会话时需要指定这些选项的位掩码组合。在建立对话之后（包括早期），pjsip_inv_session的选项成员将显示哪些功能在两个端点中通用。 /** * This enumeration shows various options that can be applied to a session. * The bitmask combination of these options need to be specified when * creating a session. After the dialog is established (including early), * the options member of #pjsip_inv_session shows which capabilities are * common in both endpoints. */
enum pjsip_inv_option
{ /** * Indicate support for reliable provisional response extension */ PJSIP_INV_SUPPORT_100REL = 1, /** * Indicate support for session timer extension. */ PJSIP_INV_SUPPORT_TIMER = 2, /** * Indicate support for UPDATE method. This is automatically implied * when creating outgoing dialog. After the dialog is established, * the options member of #pjsip_inv_session shows whether peer supports * this method as well. */ PJSIP_INV_SUPPORT_UPDATE = 4, /** * Indicate support for ICE */ PJSIP_INV_SUPPORT_ICE = 8, /** * Require ICE support. */ PJSIP_INV_REQUIRE_ICE = 16, /** * Require reliable provisional response extension. */ PJSIP_INV_REQUIRE_100REL = 32, /** * Require session timer extension. */ PJSIP_INV_REQUIRE_TIMER = 64, /** * Session timer extension will always be used even when peer doesn't * support/want session timer. */ PJSIP_INV_ALWAYS_USE_TIMER = 128, /** * Indicate support for trickle ICE */ PJSIP_INV_SUPPORT_TRICKLE_ICE = 256, /** * Require trickle ICE support. */ PJSIP_INV_REQUIRE_TRICKLE_ICE = 512, };

