/* * The callback called by sound recorder when it has finished capturing a * frame. */
static pj_status_t rec_cb(void *user_data, pjmedia_frame *frame)
{ pjmedia_snd_port *snd_port = (pjmedia_snd_port*) user_data; pjmedia_port *port; pjmedia_clock_src_update(&snd_port->cap_clocksrc, &frame->timestamp); /* Invoke preview callback */ if (snd_port->on_rec_frame) (*snd_port->on_rec_frame)(snd_port->user_data, frame); port = snd_port->port; if (port == NULL) return PJ_SUCCESS; /* Cancel echo */ if (snd_port->ec_state && !snd_port->ec_suspended) { pjmedia_echo_capture(snd_port->ec_state, (pj_int16_t*) frame->buf, 0); } pjmedia_port_put_frame(port, frame); return PJ_SUCCESS;
} 首先看snd_port->on_rec_frame这个是可选项，这里没有使用 其次就是最重要的调用pjmedia_port_put_frame，看一下这里的port参数，port = snd_port->port; 是pjmedia_snd_port类型snd_port中的pjmedia_port类型属性，snd_port->port是在pjmedia_snd_port_connect中初始化的先看一下pjmedia_snd_port_connect /* * Connect a port. */
PJ_DEF(pj_status_t) pjmedia_snd_port_connect( pjmedia_snd_port *snd_port, pjmedia_port *port)
{ pjmedia_audio_format_detail *afd; PJ_ASSERT_RETURN(snd_port && port, PJ_EINVAL); afd = pjmedia_format_get_audio_format_detail(&port->info.fmt, PJ_TRUE); /* Check that port has the same configuration as the sound device * port. */ if (afd->clock_rate != snd_port->clock_rate) return PJMEDIA_ENCCLOCKRATE; if (PJMEDIA_AFD_SPF(afd) != snd_port->samples_per_frame) return PJMEDIA_ENCSAMPLESPFRAME; if (afd->channel_count != snd_port->channel_count) return PJMEDIA_ENCCHANNEL; if (afd->bits_per_sample != snd_port->bits_per_sample) return PJMEDIA_ENCBITS; /* Port is okay. */ snd_port->port = port; return PJ_SUCCESS;
} 注意这里的参数pjmedia_port *port来自pjmedia_stream stream的port，这个port还有一点特殊即port->port_data.pdata; 其实是指向stream，即stream中有port，port也有办法指向stream，这在put_frame中会遇到。 <::>再回来看pjmedia_port_put_frame该函数其实是port->put_frame callback的封装，会直接调用port->put_frame，这个回调函数的初始化在pjmedia_stream_create 完成将port->put_frame 初始化为 stream->port.put_frame = &put_frame;，所以接下来我们看put_frame /** * Put a frame to the port (and subsequent downstream ports). */
PJ_DEF(pj_status_t) pjmedia_port_put_frame( pjmedia_port *port, pjmedia_frame *frame )
{ PJ_ASSERT_RETURN(port && frame, PJ_EINVAL); if (port->put_frame) return port->put_frame(port, frame); else return PJ_EINVALIDOP;
}

