结构体pjmedia_transport /** * This structure declares media transport. A media transport is called * by the stream to transmit a packet, and will notify stream when * incoming packet is arrived. */
struct pjmedia_transport
{ /** Transport name (for logging purpose). */ char name[PJ_MAX_OBJ_NAME]; /** Transport type. */ pjmedia_transport_type type; /** Transport's "virtual" function table. */ pjmedia_transport_op *op; /** Application/user data */ void *user_data;
}; type：传输类型，上面讲过，这里以udp为例。 op：操作集，每种传输类型实现了同一组接口。 user_data：应用层用户数据 pjmedia_transport_op 操作集是核心，这里列举重要的一些函数。 pjmedia_transport_op /** * This structure describes the operations for the stream transport. */
struct pjmedia_transport_op
{ /** * This function is called by the stream when the transport is about * to be used by the stream for the first time, and it tells the transport * about remote RTP address to send the packet and some callbacks to be * called for incoming packets. This function exists for backwards * compatibility. Transports should implement attach2 instead. * * Application should call #pjmedia_transport_attach() instead of * calling this function directly. */ pj_status_t (*attach)(pjmedia_transport *tp, void *user_data, const pj_sockaddr_t *rem_addr, const pj_sockaddr_t *rem_rtcp, unsigned addr_len, void (*rtp_cb)(void *user_data, void *pkt, pj_ssize_t size), void (*rtcp_cb)(void *user_data, void *pkt, pj_ssize_t size)); /** * This function is called by the stream to send RTP packet using the * transport. * * Application should call #pjmedia_transport_send_rtp() instead of * calling this function directly. */ pj_status_t (*send_rtp)(pjmedia_transport *tp, const void *pkt, pj_size_t size); /** * Prepare the transport for a new media session. * * Application should call #pjmedia_transport_media_create() instead of * calling this function directly. */ pj_status_t (*media_create)(pjmedia_transport *tp, pj_pool_t *sdp_pool, unsigned options, const pjmedia_sdp_session *remote_sdp, unsigned media_index); /** * This function is called by application to start the transport * based on local and remote SDP. * * Application should call #pjmedia_transport_media_start() instead of * calling this function directly. */ pj_status_t (*media_start) (pjmedia_transport *tp, pj_pool_t *tmp_pool, const pjmedia_sdp_session *sdp_local, const pjmedia_sdp_session *sdp_remote, unsigned media_index); /** * This function is called by application to stop the transport. * * Application should call #pjmedia_transport_media_stop() instead of * calling this function directly. */ pj_status_t (*media_stop) (pjmedia_transport *tp); /** * This function can be called to destroy this transport. * * Application should call #pjmedia_transport_close() instead of * calling this function directly. */ pj_status_t (*destroy)(pjmedia_transport *tp); /** * This function is called by the stream when the transport is about * to be used by the stream for the first time, and it tells the transport * about remote RTP address to send the packet and some callbacks to be * called for incoming packets. * * Application should call #pjmedia_transport_attach2() instead of * calling this function directly. */ pj_status_t (*attach2)(pjmedia_transport *tp, pjmedia_transport_attach_param *att_param);
}; op的默认初始化方法 static pjmedia_transport_op transport_udp_op = { &transport_get_info, &transport_attach, &transport_detach, &transport_send_rtp, &transport_send_rtcp, &transport_send_rtcp2, &transport_media_create, &transport_encode_sdp, &transport_media_start, &transport_media_stop, &transport_simulate_lost, &transport_destroy, &transport_attach2
}; 这里主要看attach2，这个函数传入rtp和rtcp的回调函数指针，当从网络收到数据时，会通过该回调通知。 pjmedia_transport_attach_param /** * This structure describes the data passed when calling * #pjmedia_transport_attach2(). */
struct pjmedia_transport_attach_param
{ /** * The media stream. */ void *stream; /** * Indicate the stream type, either it's audio (PJMEDIA_TYPE_AUDIO) * or video (PJMEDIA_TYPE_VIDEO). */ pjmedia_type media_type; /** * Remote RTP address to send RTP packet to. */ pj_sockaddr rem_addr; /** * Optional remote RTCP address. If the argument is NULL * or if the address is zero, the RTCP address will be * calculated from the RTP address (which is RTP port plus one). */ pj_sockaddr rem_rtcp; /** * Length of the remote address. */ unsigned addr_len; /** * Arbitrary user data to be set when the callbacks are called. */ void *user_data; /** * Callback to be called when RTP packet is received on the transport. */ void (*rtp_cb)(void *user_data, void *pkt, pj_ssize_t); /** * Callback to be called when RTCP packet is received on the transport. */ void (*rtcp_cb)(void *user_data, void *pkt, pj_ssize_t); /** * Callback to be called when RTP packet is received on the transport. */ void (*rtp_cb2)(pjmedia_tp_cb_param *param); }; transport_udp struct transport_udp
{ pjmedia_transport base; /**< Base transport. */ pj_pool_t *pool; /**< Memory pool */ unsigned options; /**< Transport options. */ unsigned media_options; /**< Transport media options. */ void *user_data; /**< Only valid when attached */ //pj_bool_t attached; /**< Has attachment? */ pj_bool_t started; /**< Has started? */ pj_sockaddr rem_rtp_addr; /**< Remote RTP address */ pj_sockaddr rem_rtcp_addr; /**< Remote RTCP address */ int addr_len; /**< Length of addresses. */ void (*rtp_cb)( void*, /**< To report incoming RTP. */ void*, pj_ssize_t); void (*rtp_cb2)(pjmedia_tp_cb_param*); /**< To report incoming RTP. */ void (*rtcp_cb)( void*, /**< To report incoming RTCP. */ void*, pj_ssize_t); unsigned tx_drop_pct; /**< Percent of tx pkts to drop. */ unsigned rx_drop_pct; /**< Percent of rx pkts to drop. */ pj_ioqueue_t *ioqueue; /**< Ioqueue instance. */ pj_sock_t rtp_sock; /**< RTP socket */ pj_sockaddr rtp_addr_name; /**< Published RTP address. */ pj_ioqueue_key_t *rtp_key; /**< RTP socket key in ioqueue */ pj_ioqueue_op_key_t rtp_read_op; /**< Pending read operation */ unsigned rtp_write_op_id;/**< Next write_op to use */ pending_write rtp_pending_write[MAX_PENDING]; /**< Pending write */ pj_sockaddr rtp_src_addr; /**< Actual packet src addr. */ int rtp_addrlen; /**< Address length. */ char rtp_pkt[RTP_LEN];/**< Incoming RTP packet buffer */ pj_bool_t enable_rtcp_mux;/**< Enable RTP & RTCP multiplexing?*/ pj_bool_t use_rtcp_mux; /**< Use RTP & RTCP multiplexing? */ pj_sock_t rtcp_sock; /**< RTCP socket */ pj_sockaddr rtcp_addr_name; /**< Published RTCP address. */ pj_sockaddr rtcp_src_addr; /**< Actual source RTCP address. */ unsigned rtcp_src_cnt; /**< How many pkt from this addr. */ int rtcp_addr_len; /**< Length of RTCP src address. */ pj_ioqueue_key_t *rtcp_key; /**< RTCP socket key in ioqueue */ pj_ioqueue_op_key_t rtcp_read_op; /**< Pending read operation */ pj_ioqueue_op_key_t rtcp_write_op; /**< Pending write operation */ char rtcp_pkt[RTCP_LEN];/**< Incoming RTCP packet buffer */
