pjmedia_snd_port_create 初始化pjmedia_snd_port_param的各种信息，调用pjmedia_snd_port_create2 pj_status_t pjmedia_snd_port_create_player(pj_pool_t *pool, int dev_id, unsigned int clock_rate, unsigned int channel_count, unsigned int samples_per_frame, unsigned int bits_per_sample, unsigned int options, pjmedia_snd_port **p_port) Create unidirectional sound device port for playing audio streams with the specified parameters. 参数: pool – Pool to allocate sound port structure. index – Device index, or -1 to let the library choose the first available device. clock_rate – Sound device's clock rate to set. channel_count – Set number of channels, 1 for mono, or 2 for stereo. The channel count determines the format of the frame. samples_per_frame – Number of samples per frame. bits_per_sample – Set the number of bits per sample. The normal value for this parameter is 16 bits per sample. options – Options flag. p_port – Pointer to receive the sound device port instance. pjmedia_snd_port_create2 用pjmedia_snd_port_creat中传入的pjmedia_snd_port_param，初始化pjmedia_snd_port（此时声音port创建），最后调用start_sound_device，Start the sound stream. start_sound_device Get device caps：获取dev_id，根据id调用函数pjmedia_aud_dev_get_info获取pjmedia_aud_dev_info Process EC settings Open the device 设置了两个回调snd_rec_cb、snd_play_cb分别为 rec_cb、play_cb status = pjmedia_aud_stream_create(&param_copy, snd_rec_cb, snd_play_cb, snd_port, &snd_port->aud_stream); Start sound stream.：pjmedia_aud_stream_start(snd_port->aud_stream); pjmedia_aud_stream_create 先通过lookup_dev搜索rec_id、play_id设备对应的工厂，然后通过工厂创建设备f->op->create_stream并设置给设备两个回调函数 rec_cb、play_cb给设备抽象pjmedia_aud_stream的ca_cb、pb_cb，lookup_dev中aud_subsys已经存储了所有的音频设备是在创建媒体端点endpoint时初始化举例来说：初始化的时候创建媒体端点pjmedia_endpt，同时初始化了音频子系统aud_subsys，把各种类型的音频设备工厂添加到全局变量 static pjmedia_aud_subsys aud_subsys;。这样当创建设备时，就可以遍历这些工厂，寻找合适的工厂，通过工厂创建设备实例。比如alsa类型的设备在alsa_dev.c pjmedia_aud_stream_start 以alsa为例，在alsa_dev.c中，调用alsa_stream_start函数，在alsa_dev.c alsa_stream_start中，会创建播放和采集两条线程。 static pj_status_t alsa_stream_start (pjmedia_aud_stream *s)
{ struct alsa_stream *stream = (struct alsa_stream*)s; pj_status_t status = PJ_SUCCESS; stream->quit = 0; if (stream->param.dir & PJMEDIA_DIR_PLAYBACK) { status = pj_thread_create (stream->pool, "alsasound_playback", pb_thread_func, stream, 0, //ZERO, 0, &stream->pb_thread); if (stream->param.dir & PJMEDIA_DIR_CAPTURE) { status = pj_thread_create (stream->pool, "alsasound_playback", ca_thread_func, stream, 0, //ZERO, 0, &stream->ca_thread); } return status;
} 以播放线程为例 static int pb_thread_func (void *arg)
{ struct alsa_stream* stream = (struct alsa_stream*) arg; snd_pcm_t* pcm = stream->pb_pcm; int size = stream->pb_buf_size; snd_pcm_uframes_t nframes = stream->pb_frames; void* user_data = stream->user_data; char* buf = stream->pb_buf; pj_timestamp tstamp; int result; pj_bzero (buf, size); tstamp.u64 = 0; snd_pcm_prepare (pcm); while (!stream->quit) { pjmedia_frame frame; frame.type = PJMEDIA_FRAME_TYPE_AUDIO; frame.buf = buf; frame.size = size; frame.timestamp.u64 = tstamp.u64; frame.bit_info = 0; result = stream->pb_cb (user_data, &frame); if (result != PJ_SUCCESS || stream->quit) break; if (frame.type != PJMEDIA_FRAME_TYPE_AUDIO) pj_bzero (buf, size); result = snd_pcm_writei (pcm, buf, nframes); if (result == -EPIPE) { PJ_LOG (4,(THIS_FILE, "pb_thread_func: underrun!")); snd_pcm_prepare (pcm); } else if (result < 0) { PJ_LOG (4,(THIS_FILE, "pb_thread_func: error writing data!")); } tstamp.u64 += nframes; } snd_pcm_drain (pcm); TRACE_((THIS_FILE, "pb_thread_func: Stopped")); return PJ_SUCCESS;
} 播放线程先通过回调拿到待播放的音频数据stream->pb_cb ，然后写到声卡snd_pcm_writei。pb_cb就是sound_port.c中的play_cb，来看下play_cb的流程。 static pj_status_t play_cb(void *user_data, pjmedia_frame *frame)
{ pjmedia_snd_port *snd_port = (pjmedia_snd_port*) user_data; pjmedia_port *port; const unsigned required_size = (unsigned)frame->size; pj_status_t status; port = snd_port->port; status = pjmedia_port_get_frame(port, frame); /* Invoke preview callback */ if (snd_port->on_play_frame) (*snd_port->on_play_frame)(snd_port->user_data, frame); return PJ_SUCCESS;
} 通过pjmedia_port* port获取一帧数据

