t;/**< Stream soft start counter */ pjmedia_rtcp_session rtcp; /**< RTCP for incoming RTP. */ pj_uint32_t rtcp_last_tx; /**< RTCP tx time in timestamp */ pj_uint32_t rtcp_interval; /**< Interval, in timestamp. */ pj_bool_t initial_rr; /**< Initial RTCP RR sent */ pj_bool_t rtcp_sdes_bye_disabled;/**< Send RTCP SDES/BYE?*/ void *out_rtcp_pkt; /**< Outgoing RTCP packet. */ unsigned out_rtcp_pkt_size; /**< Outgoing RTCP packet size. */ pj_int16_t *zero_frame; /**< Zero frame buffer. */ /* RFC 2833 DTMF transmission queue: */ unsigned dtmf_duration; /**< DTMF duration(in timestamp)*/ int tx_event_pt; /**< Outgoing pt for dtmf. */ int tx_dtmf_count; /**< # of digits in tx dtmf buf.*/ struct dtmf tx_dtmf_buf[32];/**< Outgoing dtmf queue. */ /* Incoming DTMF: */ int rx_event_pt; /**< Incoming pt for dtmf. */ int last_dtmf; /**< Current digit, or -1. */ pj_uint32_t last_dtmf_dur; /**< Start ts for cur digit. */ pj_bool_t last_dtmf_ended; unsigned rx_dtmf_count; /**< # of digits in dtmf rx buf.*/ char rx_dtmf_buf[32];/**< Incoming DTMF buffer. */ /* DTMF callback */ void (*dtmf_cb)(pjmedia_stream*, void*, int); void *dtmf_cb_user_data; void (*dtmf_event_cb)(pjmedia_stream*, void*, const pjmedia_stream_dtmf_event*); void *dtmf_event_cb_user_data; #if defined(PJMEDIA_HANDLE_G722_MPEG_BUG) && (PJMEDIA_HANDLE_G722_MPEG_BUG!=0) /* Enable support to handle codecs with inconsistent clock rate * between clock rate in SDP/RTP & the clock rate that is actually used. * This happens for example with G.722 and MPEG audio codecs. */ pj_bool_t has_g722_mpeg_bug; /**< Flag to specify whether normalization process is needed */ unsigned rtp_tx_ts_len_per_pkt; /**< Normalized ts length per packet transmitted according to 'erroneous' definition */ unsigned rtp_rx_ts_len_per_frame; /**< Normalized ts length per frame received according to 'erroneous' definition */ unsigned rtp_rx_last_cnt;/**< Nb of frames in last pkt */ unsigned rtp_rx_check_cnt; /**< Counter of remote timestamp checking */
#endif pj_sockaddr rem_rtp_addr; /**< Remote RTP address */ unsigned rem_rtp_flag; /**< Indicator flag about packet from this addr. 0=no pkt, 1=good ssrc, 2=bad ssrc pkts */ unsigned rtp_src_cnt; /**< How many pkt from this addr. */ pj_uint32_t rtp_rx_last_ts; /**< Last received RTP timestamp */ pj_uint32_t rtp_tx_err_cnt; /**< The number of RTP send() error */ pj_uint32_t rtcp_tx_err_cnt; /**< The number of RTCP send() error */ /* RTCP Feedback */ pj_bool_t send_rtcp_fb_nack; /**< Send NACK? */ pjmedia_rtcp_fb_nack rtcp_fb_nack; /**< TX NACK state. */ int rtcp_fb_nack_cap_idx; /**< RX NACK cap idx. */ };

