ialog. */ pjmedia_sdp_session *rem_sdp;/**< Remote SDP. */ pj_pool_t *pool_prov;/**< Provisional pool. */ pj_bool_t med_ch_deinit;/**< Media channel de-init-ed? */ union { struct { pjsua_msg_data *msg_data;/**< Headers for outgoing INVITE. */ pj_bool_t hangup; /**< Call is hangup? */ } out_call; struct { call_answer answers;/**< A list of call answers. */ pj_bool_t hangup;/**< Call is hangup? */ pjsip_dialog *replaced_dlg; /**< Replaced dialog. */ } inc_call; } call_var; } async_call; /**< Temporary storage for async outgoing/incoming call. */ pj_bool_t rem_offerer; /**< Was remote SDP offerer? */ unsigned rem_aud_cnt; /**< No of active audio in last remote offer. */ unsigned rem_vid_cnt; /**< No of active video in last remote offer. */ pj_bool_t rx_reinv_async;/**< on_call_rx_reinvite() async. */ pj_timer_entry reinv_timer; /**< Reinvite retry timer. */ pj_bool_t reinv_pending;/**< Pending until CONFIRMED state. */ pj_bool_t reinv_ice_sent;/**< Has reinvite for ICE upd sent? */ pjsip_rx_data *incoming_data;/**< Cloned incoming call rdata. On pjsua2, when handling incoming call, onCreateMediaTransport() will not be called since the call isn't created yet. This temporary variable is used to handle such case, see ticket #1916. */ struct { pj_bool_t enabled; pj_bool_t remote_sup; pj_bool_t remote_dlg_est; pjsua_op_state trickling; int retrans18x_count; pj_bool_t pending_info; pj_timer_entry timer; } trickle_ice; pj_timer_entry hangup_timer; /**< Hangup retry timer. */ unsigned hangup_retry; /**< Number of hangup retries. */ unsigned hangup_code; /**< Hangup code. */ pj_str_t hangup_reason; /**< Hangup reason. */ pjsua_msg_data *hangup_msg_data;/**< Hangup message data. */
