/** * This enumeration specifies how we should offer call hold request to * remote peer. The default value is set by compile time constant * PJSUA_CALL_HOLD_TYPE_DEFAULT, and application may control the setting * on per-account basis by manipulating \a call_hold_type field in * #pjsua_acc_config. */
typedef enum pjsua_call_hold_type
{ /** * This will follow RFC 3264 recommendation to use a=sendonly, * a=recvonly, and a=inactive attribute as means to signal call * hold status. This is the correct value to use. */ PJSUA_CALL_HOLD_TYPE_RFC3264, /** * This will use the old and deprecated method as specified in RFC 2543, * and will offer c=0.0.0.0 in the SDP instead. Using this has many * drawbacks such as inability to keep the media transport alive while * the call is being put on hold, and should only be used if remote * does not understand RFC 3264 style call hold offer. */ PJSUA_CALL_HOLD_TYPE_RFC2543 } pjsua_call_hold_type;

